webpackJsonp([5305894438959],{4165:function(a,t){a.exports={data:{markdownRemark:{html:'<p><img src="https://danmaq.com/image/misc/LS1_s.jpg" alt="クリックすると拡大します。"></p>\n<p>最近なんだかこんな気分。ダメダヨ？</p>\n<h2>(拍)パチュリーにバク転されながらぼこぼこにされました。</h2>\n<p>パチェは喘息の調子さえ良ければレミィ以上の体術もこなせるんですきっと。その辺自分でやりゃいいもののわざわざ人形動かして仕事するアリスと似てるモノがあるのかも。</p>\n<h2>(拍)今年中に新作出せそうですか？</h2>\n<p>「完全版」となると厳しいかも。</p>\n<h2>(拍)こうですか？わかりません！</h2>\n<p>たぶんそのとおり。</p>\n<h2>(拍)夢終劇をコミック化したらどうなるのだろうと思う今日この頃</h2>\n<p>それは三次創作に任せた \'｀</p>\n<h2>(拍)ドメインを個人情報で登録してるのはわざと？</h2>\n<p><a href="http://e.danmaq.com/">PURCHASE</a>をクリックしてみよう。いや個人で通販やってる以上差出人不明でブツ送りつけるのもあれですし。とりあえず<a href="http://sasakama.s13.xrea.com/sos/n18_858.html">G県厨</a>ライクな体験を一通りは受けてきたので今更どうってことだったりするんですがね。</p>\n<h2>そんなわけで</h2>\n<p>テスト以前のバージョンなので<a href="http://thg.danmaq.com/">まだこっそりと</a>。マップも音も何もかもが仮なので今後ガラッと変わると思う。(特にマップなんてカップヌードルBIGを食い始めてから食い終わるまでの時間で突貫で作ったものだったりするしｗ)</p>',frontmatter:{cover:null,date:"2008-02-27T23:43:00+09:00",strDate:"2008/2/27",title:"ダメカナ？"}}},pathContext:{path:"/ja/blog/2008/02/27-ダメカナ？/",langKey:"ja"}}}});
